import React from 'react';

function AboutMe() {
  return (
    <section className="about-me">
      <div className="about-me-text">
        <h1>Who am I?</h1>
        <p>My name is Athul. I'm a Software Engineering student at RMIT University, passionate about technology
          and innovation. Beyond academics, I enjoy exploring new tech, gaming, and refining my programming skills.</p>
        <p>Check out my portfolio to see my projects!</p>
      </div>
      <img src="images/personal_image.jpg" alt="This is me" />
    </section>
  );
}

export default AboutMe;
